import React, { Component } from 'react';
import admin_header_icon from '../images/admin/admin_header_icon.png';
import '../style/header.css';

export default class Header extends Component {
    render() {
        return (
            <div className="row">
                <div className="col-md-3">
                    <img src={admin_header_icon} alt="ADMIN" />
                </div>


                <div className="col-md-6">
                    <div className="searchbar">
                        <input className="search_input" type="text" name="" placeholder="Search..." />
                        <a href="#" className="search_icon"><i className="fas fa-search" style={{ cursor: "pointer", fontSize: "20px"}}></i></a>
                    </div>
                </div>
                <div>
                    <i className="fas fa-search"></i>
                    <i className="fas fa-users" style={{ paddingRight: "5%", fontSize: "24px" }}></i>
                </div>
            </div>
        );
    }
}
